Dotări:
- 8300 documente
- 4 calculatoare cu acces Internet;
- căști audio;
- webcam-uri;
- videoproiector cu ecran de proiecție;
- copiator, scanner, imprimantă;
Servicii oferite:
împrumutul documentelor la domiciliu;
- acces la expoziții organizate în spațiul bibliotecii;
- acces la buletinele informative ale partenerilor& colaboratorilor;
- acces gratuit la Internet ;
- acces la echipamentele de multiplicare, scanare, copiere, printare;
- servicii de îndrumare pentru completarea formularelor altor instituții publice;
- cursuri de instruire în domeniile : IT, agricol, financiar (sau la cererea utilizatorilor);
- servicii pentru petrecerea timpului liber:
+ ateliere tematice: teatru, poezie, lucru manual etc;
+ videoproiecții filme, documentare etc. ;

